import React from 'react';
import { useDispatch, useSelector } from 'react-redux';
import { Link } from 'react-router-dom';
import { useNavigate } from 'react-router-dom';
import { delUser } from '../redux/actions/userAction';

function NavBar() {
  const navigate = useNavigate();
  const user = useSelector((state) => state.user);
  const dispatch = useDispatch()
  const loguot = () => {
    window.localStorage.clear();
    dispatch(delUser());

  };
  return (
    <div className="nav_wrapper">
      <div className="nav_left_wrapper">
        <div className="nav_logo">{/* <img src={sipit} alt="sipit" /> */}</div>
        <div className="nav_name"></div>
      </div>
      <div className="nav_right_wrapper">
        {user && (
          <div className="nav_link_wrapper">
            <div
              className="nav_link"
              onClick={() => {
                navigate('/');
              }}
            >
              <p className="p_nav">Главная</p>
            </div>
          </div>
        )}
        {!user && (
          <div className="nav_link_wrapper">
            <div
              className="nav_link"
              onClick={() => {
                navigate('/login');
              }}
            >
              <p className="p_nav">Войти</p>
            </div>
          </div>
        )}
        {!user && (
          <div className="nav_link_wrapper">
            <div
              className="nav_link"
              onClick={() => {
                navigate('/registration');
              }}
            >
              <p className="p_nav">Регистрация</p>
            </div>
          </div>
        )}
        <div className="nav_link_wrapper">
          <div className="nav_link">
            <Link to="/">
              <p className="p_nav">Контакты</p>
            </Link>
          </div>
        </div>
        {user && (
          <div className="nav_link_wrapper">
            <div className="nav_link" onClick={() => {}}>
              <Link to="/">
                <p className="p_nav">Выйти</p>
              </Link>
            </div>
          </div>
        )}
      </div>
    </div>
  );
}

export default NavBar;
